  "fixed_xml": "<ITEM>13. Herr Johann Heinrich Philipp Schramm, Buchdrucker in Tübingen, ist gesinnet seine Folio-Bibel mit grobem Druck, welche durchaus mit vielen schönen Kupferen und Holtzschnitten gezieret, und davon ihm alle Exemplaria aufgegangen, wiedernm auf das Neue, und zwar Subscriptions-weise zu drucken: <BIBL><TITLE>Folio-Bibel</TITLE> mit grobem Druck, welche durchaus mit vielen schönen Kupferen und Holtzschnitten gezieret</BIBL>, Wer bis nächstkommtige Lichtmeß <YEAR>1747.</YEAR> mit <PRIZE>45. xr.</PRIZE> darauf praenumerirt, bekommt auf nämliche Zeit <YEAR>1748.</YEAR> gegen Annach <PRIZE>45. xr.</PRIZE> postnumenumeration und Bezahlung der Fracht, ein Exemplar; Wer aber bis dahin nicht praenumerirt, muß so dann <PRIZE>fl. 2. 15. xr.</PRIZE>, also <PRIZE>45. xr.</PRIZE> mehrers bezahlen. Und können die Praenumerations-Gelder allhier an Herrn Christoph Burckhardt in dem Eptinger Hof bey St. Martin, gegen Schein bezahlt werden.</ITEM>",
